(1403, 38, 3, 'Cá chép vàng', 'Loại 3:Cá cỡ trung, vảy mềm, thân thon dài, vây vàng rực rỡ, giá trị làm cảnh cao và nấu dưa ăn cũng ngon phết', 16118, 0, 1, 0, 0, 0, -1, -1, -1),
(1404, 38, 3, 'Cá chim xanh', 'Loại 3:Cá cỡ trung, vảy cứng, thân bầu dục, ăn tạp, răng sắc cắn rất đau. Sát thủ cắn bi những ai bơi ở khu nó sống', 9595, 0, 1, 0, 0, 0, -1, -1, -1),
