(1406, 40, 3, 'Cá heo xanh', 'Loại 1: Cá cỡ lớn, không vảy, thân thon dài, thông minh, nhưng hay hấp diêm tập thể những con cái trong bầy', 9608, 0, 1, 0, 0, 0, -1, -1, -1),
