(1408, 40, 3, 'Ôc hương', 'Loại 4:Ôc hiếm ở vùng biển sâu, vỏ cứng như kim cương nhưng bên trong là thịt ốc ngon vcl', 9602, 0, 1, 0, 0, 0, -1, -1, -1),
