INSERT INTO `task_main_template` (`id`, `NAME`, `detail`) VALUES
(0, 'Nhiệm vụ đầu tiên', 'Chi tiết nhiệm vụ'),
(1, 'Nhiệm vụ tập luyện', 'Hãy đánh ngã 10 mộc nhân, sau đó quay về nhà báo cáo với ông %2\r\n\r\nThưởng 5000 sức mạnh\r\nThưởng 5000 tiềm năng\r\nThưởng 50000 vàng\r\nThưởng 100 ngọc'),
(2, 'Nhiệm vụ tìm thức ăn', 'Tìm đến %3, tiêu diệt bọn quái %4 và nhặt về 10 đùi gà\r\n\nThưởng 7000 sức mạnh\nThưởng 7000 tiềm năng\nThưởng 100K vàng\r\nThưởng 200 ngọc\nHọc được kỹ năng bay'),
(3, 'Tìm kiếm sao băng', 'Đi khám phá xem vật thể lạ vừa rơi xuống hành tinh\r\n\r\nThưởng 7K sức mạnh\r\nThưởng 7K tiềm năng\r\nThưởng 150K vàng\r\nThưởng 300 ngọc'),
(4, 'Nhiệm vụ khó khăn', 'Đi tới %6, tiêu diệt lũ %4 mẹ\r\n\r\nThưởng 20K sức mạnh\r\nThưởng 20K tiềm năng\r\nThưởng 300K vàng\r\nThưởng 400 ngọc'),
(5, 'Nhiệm vụ gia tăng sức mạnh', 'Hãy đi tập luyện để gia tăng sức mạnh\r\n\r\nThưởng 30K sức mạnh\r\nThưởng 30K tiềm năng\r\nThưởng 500K vàng\r\nThưởng 500 ngọc\r\nThưởng CT Tàu Pảy Pảy'),
(6, 'Nhiệm vụ trò chuyện', 'Đi tới trạm tàu vũ trụ, trò chuyện với %7\r\n\r\nThưởng 10K sức mạnh\r\nThưởng 10K tiềm năng\r\nThưởng 100K vàng\r\nThưởng 100 ngọc'),
(7, 'Nhiệm vụ giải cứu', 'Lên đường tiêu diệt bọn %9, giải cứu %8\nQuay về báo cáo với %7 để nhận thưởng\r\n\r\nThưởng 30K sức mạnh\r\nThưởng 30K tiềm năng\r\nThưởng 500K vàng\r\nThưởng 700 ngọc\r\nThưởng Găng Tay'),
(8, 'Nhiệm vụ ân nhân xuất sắc', 'Về %1, gặp và trò chuyện với %8\nSau đó về nhà kể lại mọi chuyện với ông %2\r\n\r\nThưởng 50K sức mạnh\r\nThưởng 50K tiềm năng\r\nThưởng 800K vàng\r\nThưởng 800 ngọc\r\nThưởng Thú Cưỡi Vip'),
(9, 'Nhiệm vụ tiên học lễ', 'Tìm đường tới %11, trò chuyện với %10 và xin làm đệ tử\r\n\r\nThưởng 50K sức mạnh\r\nThưởng 50K tiềm năng\r\nThưởng 900K vàng\r\nThưởng 900 ngọc'),
(10, 'Nhiệm vụ học phí', 'Tiêu diệt %12 thể hiện sức mạnh cho %10 thấy\r\n\r\nThưởng 100K sức mạnh\r\nThưởng 100K tiềm năng\r\nThưởng 1TR vàng\r\nThưởng 1000 ngọc\r\nThưởng Áo Giáp'),
(11, 'Tiêu Diệt Pilaf', 'Thể hiện sức mạnh và quyết tâm bảo vệ ngọc rồng(boss xuất hiện tại các map như: đảo kame, đảo guru, vách núi đen)\r\n\r\nThưởng 100K sức mạnh\r\nThưởng 100K tiềm năng\r\nThưởng 1TR vàng\r\nThưởng 1000 ngọc\r\nThưởng Ngọc Rồng 3 Sao'),
(12, 'Nhiệm vụ xin phép', 'Quay về nhà xin ông %2 cho phép tham gia bang hội\r\n\r\nThưởng 100K sức mạnh\r\nThưởng 100K tiềm năng\r\nThưởng 1TR vàng\r\nThưởng 1000 ngọc'),
(13, 'Nhiệm vụ gia nhập bang hội', 'Gia nhập 1 bang hội cùng những người đồng đội thiện chí\nCùng làm nhiệm với nhau không quản khó khăn\r\n\r\nThưởng 100K sức mạnh\r\nThưởng 100K tiềm năng\r\nThưởng 1TR vàng\r\nThưởng 1000 ngọc\r\nThưởng Vật phẩm đeo lưng '),
(14, 'Nhiệm vụ bang hội lần 1', 'Cùng phối hợp với 1 người đồng đội lên đường làm nhiệm vụ\r\n\nThưởng 150K sức mạnh\r\nThưởng 150K tiềm năng\r\nThưởng 1TR5 vàng\r\nThưởng 1500 ngọc\r\nThưởng Quần'),
(15, 'Nhiệm vụ bang hội lần 2', 'Cùng phối hợp với 1 người đồng đội lên đường làm nhiệm vụ\r\n\r\nThưởng 300K sức mạnh\r\nThưởng 300K tiềm năng\r\nThưởng 2TR vàng\r\nThưởng 3500 ngọc\r\nThưởng Giày'),
(16, 'Tiêu diệt quái vật', 'Tới các hành tinh tiêu diệt quái vật, giải cứu thường dân\r\n\r\nThưởng 300K sức mạnh\r\nThưởng 300K tiềm năng\r\nThưởng 3TR vàng\r\nThưởng 3500 ngọc\r\nThưởng Rada'),
(17, 'Nhiệm vụ giúp đỡ Cui', 'Tìm đường tới thành phố Vegeta, gặp và nói chuyện với Cui\r\n\r\nThưởng 100K sức mạnh\r\nThưởng 100K tiềm năng\r\nThưởng 2TR vàng\r\nThưởng 2000 ngọc'),
(18, 'Nhiệm vụ bất khả thi', 'Tiêu diệt đàn em tay sai của Fide tại Xayda\r\n\r\nThưởng 1TR sức mạnh\r\nThưởng 1TR tiềm năng\r\nThưởng 5TR vàng\r\nThưởng 5000 ngọc\r\n'),
(19, 'Nhiệm vụ chạm trán đệ tử', 'Tiêu diệt đàn em tay sai của Fide\r\n\r\nThưởng 1,5TR sức mạnh\r\nThưởng 1,5TR tiềm năng\r\nThưởng 2TR vàng\r\nThưởng 7000 ngọc\r\nThưởng Thú Cưng ( Pet )'),
(20, 'Nhiệm vụ Tiểu Đội Sát Thủ', 'Tiêu diệt 5 tên trong đội Tiểu Đội Sát Thủ\r\n\r\nThưởng 3TR sức mạnh\r\nThưởng 3TR tiềm năng\r\nThưởng 4TR vàng\r\nThưởng 10000 ngọc\r\nThưởng Linh Thú'),
(21, 'Nhiệm vụ chạm trán Fide đại ca', 'Luyện tập đạt 2 tỷ sức mạnh\nLên đường tìm diệt Fide đại ca\r\n\r\nThưởng 10TR sức mạnh\r\nThưởng 10TR tiềm năng\r\nThưởng 20TR vàng\r\nThưởng 20000 ngọc'),
(22, 'Nhiệm vụ chạm trán Rôbốt sát thủ lần 1', 'Hãy đến thành phố phía Nam, đảo Balê hoặc Cao nguyên tìm gặp Rôbốt sát thủ để tiêu diệt\r\n\r\nThưởng 10TR sức mạnh\r\nThưởng 10TR tiềm năng\r\nThưởng 20TR vàng\r\nThưởng 20000 ngọc'),
(23, 'Nhiệm vụ chạm trán Rôbốt sát thủ lần 2', 'Hãy đến thành phố phía Bắc, ngọn núi phía Bắc hoặc thung lũng phía Bắc tìm diệt bọn Rôbốt sát thủ\r\n\r\nThưởng 10TR sức mạnh\r\nThưởng 10TR tiềm năng\r\nThưởng 20TR vàng\r\nThưởng 20000 ngọc'),
(24, 'Nhiệm vụ giải cứu thị trấn Ginder', 'Lên đường tới thị trấn Ginder, tiêu diệt nỗi hiểm họa gần đây tại thị trấn Ginder\r\n\r\nThưởng 20TR sức mạnh\r\nThưởng 20TR tiềm năng\r\nThưởng 40TR vàng\r\nThưởng 30000 ngọc'),
(25, 'Tiêu Diệt Xên', 'Hãy lên đường tiêu diệt bọn tay sai của Xên\r\n\r\nThưởng 20TR sức mạnh\r\nThưởng 20TR tiềm năng\r\nThưởng 40TR vàng\r\nThưởng 30000 ngọc'),
(26, 'Tiêu Diệt Xên <2>', 'Hãy lên đường tiêu diệt bọn tay sai của Xên\r\n\r\nThưởng 20TR sức mạnh\r\nThưởng 20TR tiềm năng\r\nThưởng 40TR vàng\r\nThưởng 30000 ngọc'),
(27, 'Báo cáo tình hình', 'Hãy quay trở lại báo cáo tình hình với Cui'),
(28, 'Tiêu diệt Xên <3>', 'Hãy lên đường tiệt diệt chúng'),
